Blockly.Msg["TEXT_INDEXOF_INPUT_INTEXT"] = "block text - Title of blocks allowing users to find text.  See [https://github.com/google/blockly/wiki/Text#finding-text https://github.com/google/blockly/wiki/Text#finding-text]. [[File:Blockly-find-text.png]].";
Blockly.Msg["TEXT_INDEXOF_OPERATOR_FIRST"] = "dropdown - See [https://github.com/google/blockly/wiki/Text#finding-text https://github.com/google/blockly/wiki/Text#finding-text]. [[File:Blockly-find-text.png]].";
