Blockly.Msg["TEXT_CHARAT_HELPURL"] = "url - Information about extracting characters (letters, number, symbols, etc.) from text.";
Blockly.Msg["TEXT_CHARAT_INPUT_INTEXT"] = "block text - Appears before the piece of text from which a letter (or number, punctuation character, etc.) should be extracted, as shown below.  See [https://github.com/google/blockly/wiki/Text#extracting-a-single-character https://github.com/google/blockly/wiki/Text#extracting-a-single-character]. [[File:Blockly-text-get.png]]";
Blockly.Msg["TEXT_CHARAT_FROM_START"] = "dropdown - Indicates that the letter (or number, punctuation character, etc.) with the specified index should be obtained from the preceding piece of text.  See [https://github.com/google/blockly/wiki/Text#extracting-a-single-character https://github.com/google/blockly/wiki/Text#extracting-a-single-character]. [[File:Blockly-text-get.png]]";
Blockly.Msg["TEXT_CHARAT_FROM_END"] = "block text - Indicates that the letter (or number, punctuation character, etc.) with the specified index from the end of a given piece of text should be obtained. See [https://github.com/google/blockly/wiki/Text#extracting-a-single-character https://github.com/google/blockly/wiki/Text#extracting-a-single-character]. [[File:Blockly-text-get.png]]";
