Blockly.Msg["TEXT_CHARAT_LAST"] = "block text - Indicates that the last letter (or number, punctuation mark, etc.) of the following piece of text should be retrieved.  See [https://github.com/google/blockly/wiki/Text#extracting-a-single-character https://github.com/google/blockly/wiki/Text#extracting-a-single-character]. [[File:Blockly-text-get.png]]";
Blockly.Msg["TEXT_CHARAT_RANDOM"] = "block text - Indicates that any letter (or number, punctuation mark, etc.) in the following piece of text should be randomly selected.  See [https://github.com/google/blockly/wiki/Text#extracting-a-single-character https://github.com/google/blockly/wiki/Text#extracting-a-single-character]. [[File:Blockly-text-get.png]]";
Blockly.Msg["TEXT_CHARAT_TAIL"] = "block text - Text that goes after the rightmost block/dropdown when getting a single letter from a piece of text, as in [https://blockly-demo.appspot.com/static/apps/code/index.html#3m23km these blocks] or shown below.  For most languages, this will be blank. [[File:Blockly-text-get.png]]";
Blockly.Msg["TEXT_CHARAT_TOOLTIP"] = "tooltip - See [https://github.com/google/blockly/wiki/Text#extracting-a-single-character https://github.com/google/blockly/wiki/Text#extracting-a-single-character]. [[File:Blockly-text-get.png]]";
Blockly.Msg["TEXT_GET_SUBSTRING_TOOLTIP"] = "See [https://github.com/google/blockly/wiki/Text#extracting-a-region-of-text https://github.com/google/blockly/wiki/Text#extracting-a-region-of-text].";
Blockly.Msg["TEXT_GET_SUBSTRING_HELPURL"] = "url - Information about extracting characters from text.  Reminder: urls are the lowest priority translations.  Feel free to skip.";
